style.css:
@-moz-document domain("youtube.com"), url-prefix("https://www.youtube.com/") {
#masthead-container,
    ytd-masthead {
        display: none !important;
    }
    ytd-watch-flexy[is-two-columns_] #primary,
    ytd-watch-flexy[is-two-columns_] #secondary {
        max-width: 100% !important;
    }
    ytd-watch-flexy[is-two-columns_] #player {
        width: 100% !important;
        max-width: 100% !important;
    }
    ytd-watch-flexy[is-two-columns_] #player-theater-container {
        height: 100vh !important;
        width: 100% !important;
    }
    ytd-watch-flexy[is-two-columns_] #columns {
        margin-top: 0 !important;
        display: flex;
        justify-content: center;
    }
    ytd-player {
        position: fixed !important;
        top: 0 !important;
        left: 0 !important;
        width: 100% !important;
        height: 100vh !important;
        z-index: 1000 !important;
    }
}
